import React from 'react';
import './About.css';

const About = () => {
  return (
    <section className="container about">
      <h2>Career Summary</h2>
      <p>
        Project-driven front-end developer with a strong foundation in HTML, CSS, JavaScript, and PHP (WHMCS). 
        Previously worked as a Workflow Engineer, automating business processes and developing custom modules 
        and tools across Google Workspace and WHMCS environments. Passionate about building responsive user 
        interfaces and currently expanding knowledge in React, Tailwind, and modern front-end development practices. 
        Open to remote opportunities.
      </p>
    </section>
  );
};

export default About;
